import React, {useState} from 'react';
import logo from './logo.png'
import Login1 from './Login1.css'
import { useNavigate } from 'react-router-dom';

export let Login = function(){
  const [email, setEmail] = useNavigate('')
  const [password, setPassword] = useNavigate('')

  const navigate = useNavigate();
  function register(){
      navigate('/')
  }
  let login = async()=>{
    let url = 'http://localhost:8080/tictac/login/'+email+'/'+password
    let data = await fetch(url,{
      method: 'GET'
    }).then(response => response.json())
  }
    

    
    return(<div className="App">
    <img src={logo} className="logo" alt="Business view - Reports" />
    <form className="form" >
      <div className="input-group">
        <label htmlFor="email">Email</label>
        <input type="email" name="email" placeholder="nome@email.com.br" onChange={setEmail} />
      </div>
      <div className="input-group">
        <label htmlFor="password">Password</label>
        <input type="password" name="password" onChange={setPassword}/>
      </div>
      <button className="primary">Iniciar sesion</button>
    </form>
    <button className="secondary" onClick={register}>
      Registrar
    </button>
  </div>)
}
